    Location of the Active and Inactive areas of the Model Boundary for the Northern
    High Plains Groundwater-Flow Model in Parts of Colorado, Kansas, Nebraska, South
    Dakota, and Wyoming",nt"tracking_summary": {ntt"total": 9,ntt"recent":
