    "2014-09-02T23:00:35.665854",nt"name": "ds-777-spatial-location-of-the-active-and-inactive-areas-of-the-model-boundary-for-the-northern",nt"isopen":
    false,nt"url": null,nt"notes": "This data set defines the boundary of the
    northern High Plains aquifer. It is one of many developed in support of The High
    Plains Groundwater Availability Project and the U.S. Geological Survey Data Series
    Report: Geodatabase Compilation of Hydrogeologic, Remote Sensing, and Water-Budget-Component
    data for the High Plains aquifer, 2011 (DS 777). The creation of the model grid
    is an important first step in developing a groundwater-flow model, because all model
    inputs including hydraulic properties, wells, and boundary conditions are assigned
    to the model cells. The northern High Plains groundwater-flow model boundary feature
    dataset contains three feature classes; the model grid cells for the northern High
    Plains groundwater-flow model in both polygon (cell) and point (centroid) format
    and the external boundary of the model. The model grid contains 449,175 cells, 565
    rows and 795 columns. Each cell is 1,000 feet per side. The model grid is not rotated.
    The external boundary includes the active and inactive areas of the model.",nt"license_title":
